import React from 'react';

import { Container, ListaMenu, Link } from './styles';

function Header() {
  return(
    <Container>
        <h1>Forniture</h1>

        <nav>
            <ListaMenu>
                <Link>Home</Link>
                <Link>About</Link>
                <Link>Contact</Link>
                <Link>Contact</Link>
                <Link>Contact</Link>
                <Link>Contact</Link>
            </ListaMenu>
        </nav>
    </Container>
  );
}

export default Header;
